import { Link } from "react-router-dom";
const Footer = () => {
    return (
        <footer>
            <p>
                <Link to="/user/mypage">마이페이지</Link>
                <Link to="/store/search">검색 페이지</Link>
            </p>
        </footer>
    );
};
export default Footer;
